    //STATE
    const [ search, setSearch] = useState([])
    //END OF STATE
    return(
        <div>
            Find countries <input value={search} onChange={(e) => handleTyping(setSearch ,e)} />
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
